import PropTypes from 'prop-types'
function Header( { text = 'Feedback UI', bgColor, textColor} ) {

    const headerStyle = {
        backgroundColor: bgColor, 
        color: textColor,
    }
    return (

        <header style={headerStyle}>
            <div className="container">
                <h2>{text}</h2>
            </div>
        </header>

    )
}



Header.propTypes = {

    text: PropTypes.string
};

export default Header;
